import React, { useState } from 'react'
import './test.css'
let nextId = 0;
const Test = () => {

  const [name, setName] = useState('');
  const [artists, setArtists] = useState([]);
console.log(artists)
  return (
    <>
      <h1>Inspiring sculptors:</h1>
      <input
        value={name}
        onChange={e => setName(e.target.value)}
      />
      <button onClick={() => {
        setArtists([
          ...artists,
          { id: nextId++, name: name }
        ]);
      }}>Add</button>
      <ul>
        {artists.map(artist => (
          <li key={artist.id}>{artist.name}</li>
        ))}
      </ul>
    </>
  );
}

export default Test
